import Header from './components/Header';
import Navbar from './components/Navbar';
import Details from './pages/details';

function App() {
  return (
<div class="flex h-screen">
  <div class="w-3/4 bg-gray-100 h-full">
   <Navbar/>
  </div>

  <div class="w-full h-16">
    <Header/>
    </div>

    <div class="h-full overflow-y-auto px-6 py-4">
     <Details/>
    </div>
  </div>

);
}

<div className="flex h-screen">
  <header className="w-full h-16 bg-gray-200"></header>
  <div className="w-3/4 h-full overflow-y-auto px-6 py-4">
    <details />
  </div>
  <div className="w-1/4 bg-gray-200 h-full flex flex-col justify-between">
    <Navbar />
  </div>
</div>






export default App;
